Classic Star Wars Volume 2 - The Rebel Storm (1995) (Digital) (Bean-Empire)

Promotional info - &quot;There was no peace for the crew members of the Millennium Falcon between Star Wars and The Empire Strikes Back! Follow their adventures as they plunge head first into an underwater hunt that leads to a demonsquid, a treasonous and plotting Kraaken, the ferocious night beast, lost power gems, stranded Calamarians, and giant sea worms! Will the depths of the oceans spell defeat for the Rebels, or will they emerge victorious?&quot;

This is the digital copy by Bean-Empire. Thanks to them for their efforts, please seed and enjoy!

